TxtScaling:false,minFontSizeScaling:14,useng:true,transition:{type:0},mmot:false,mdi:'Slide299121c',st:'Normal Slide',ccProperties:{1280:{pos:7,x:35,y:92.0833}},audCC:[{sf:19,ef:228,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">Grasses and other herbaceous cover can stabilize bare mineral soil and minimize erosion.</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}},{sf:229,ef:342,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">This greatly benefit close-out on landings.</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}},{sf:343,ef:465,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">Seeding with native grasses is preferable to nonnative species,</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}},{sf:466,ef:678,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">which may even be considered ecologically hazardous and may be prohibited in Massachusetts.</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}},{sf:679,ef:1017,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">That is why the use of straw bales, which do not typically include seeds, is preferred over hay bales to reduce the introduction of nonnative seeds on the site.</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}},{sf:1018,ef:1206,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">When native grasses are not an option, be sure to use noninvasive species.</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}},{sf:1207,ef:1431,t:{1280:'<div><div style="margin-left:0px;text-align:center;"><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><span style="">For seeding guidelines, see page 21 in the Massachusetts BMP Manual.</span></span><span class="cp-actualText" style="line-height:120%;color:#000000;font-size:16px;font-family:\'Times New Roman regular\',Times New Roman;"><br></span></div></div>'}}],vidCC:[],accstr:' ',si:[{n:'Image_1285',t:15},{n:'Text_Caption_562',t:19},{n:'Text_Caption_563',t:19},{n:'Text_Caption_564',t:19},{n:'Text_Caption_565',t:19},{n:'Image_1286',t:15},{n:'Image_1287',t:15},{n:'Text_Caption_566',t:19},{n:'Text_Caption_567',t:19},{n:'Image_1288',t:15},{n:'SmartShape_175',t:612},{n:'Text_Caption_568',t:19},{n:'Text_Caption_569',t:19}]